tables.table_schema:
CREATE TABLE individual_performance (
    id UUID PRIMARY KEY,
    first_name VARCHAR(50),
    last_name VARCHAR(50),
    kpi_score FLOAT
);

CREATE TABLE team_performance (
    team_id UUID PRIMARY KEY,
    team_name VARCHAR(50),
    average_kpi FLOAT
);

CREATE TABLE employees (id INT PRIMARY KEY, name VARCHAR(255), team VARCHAR(255), location VARCHAR(255));
CREATE TABLE performance_metrics (id INT PRIMARY KEY, employee_id INT, kpi_name VARCHAR(255), value DECIMAL);
CREATE TABLE teams (id INT PRIMARY KEY, team_name VARCHAR(255), leader VARCHAR(255));
CREATE TABLE kpi_targets (id INT PRIMARY KEY, kpi_name VARCHAR(255), target DECIMAL);

CREATE TABLE individual_performance (
  id INT,
  name VARCHAR(50),
  kpi_score FLOAT
);

CREATE TABLE team_performance (
  id INT,
  team_name VARCHAR(50),
  total_kpi_score FLOAT
);

CREATE TABLE kpi_metrics (
  metric_id INT,
  metric_name VARCHAR(50),
  weightage FLOAT
);

CREATE TABLE individual_kpi_data (
  id INT,
  metric_id INT,
  individual_id INT,
  kpi_value FLOAT
);

CREATE TABLE team_kpi_data (
  id INT,
  metric_id INT,
  team_id INT,
  kpi_value FLOAT
);
